import React, { useState } from "react";
import Quiz from "../components/Quiz";
import burnoutData from "../assessments/burnout.json";
import depressionData from "../assessments/depression.json";
import ptsdData from "../assessments/ptsd.json";
import moneyData from "../assessments/money.json";

export default function Assessments() {
  const [activeQuiz, setActiveQuiz] = useState(null);

  const quizzes = {
    burnout: { title: "Burnout Assessment", data: burnoutData },
    depression: { title: "Depression Assessment (PHQ-9)", data: depressionData },
    ptsd: { title: "PTSD Assessment (PCL-5)", data: ptsdData },
    money: { title: "Money Personality Quiz", data: moneyData }
  };

  return (
    <div className="assessments-container">
      {!activeQuiz ? (
        <div className="quiz-list">
          <h2>Select an Assessment</h2>
          <ul>
            {Object.keys(quizzes).map((key) => (
              <li key={key}>
                <button onClick={() => setActiveQuiz(key)}>
                  {quizzes[key].title}
                </button>
              </li>
            ))}
          </ul>
        </div>
      ) : (
        <Quiz
          title={quizzes[activeQuiz].title}
          data={quizzes[activeQuiz].data}
          onBack={() => setActiveQuiz(null)}
        />
      )}
    </div>
  );
}
